B.aFZ=new A.u("Material Design 3",null,null,null,null,null,null,null,null,null,null)
B.aCH=new A.u("The in Flutter 2.10.0 introduced Material 3 ColorScheme is used and fully supported. However, components in Flutter 2.10.x do not yet use any of the updated ColorScheme's new colors by default. When you enable FlexColorScheme's component sub-themes you get a theme that is close to the Material 3 style by default. With the component sub-themes settings you can adjust it further, and e.g. change which ColorScheme color each component uses. This is a convenient way to select and use any ColorScheme based color, as the themed color for components included in FlexColorScheme's supported component theme customization capabilities.\n\nVery few Material 3 widgets and styles are available in Flutter 2.10.x and earlier. The updated ColorScheme, NavigationBar and a flag to use a selection indicator on NavigationRail are the only current M3 features.\n\nThere is a toggle in ThemeData that you can turn on to enable available built-in M3 styles in Flutter. It still has almost no effect on UI widget defaults in Flutter. The indicator on the NavigationRail is the only thing it affects so far. It will be used more in future Flutter versions. When it is, we can use the toggle here to see what it does.",null,null,null,null,null,null,null,null,null,null)
B.amR=new A.cI(null,B.aFZ,B.aCH,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aGa=new A.u("Light theme blend level",null,null,null,null,null,null,null,null,null,null)
B.Fq=new A.u("Adjust the surface, background, scaffold and dialog blend level. Also impacts surfaces when seed colors are used. Seed based surfaces already include a touch of primary, but you can make it stronger with surface blends",null,null,null,null,null,null,null,null,null,null)
B.amS=new A.cI(null,B.aGa,B.Fq,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aEi=new A.u("With FlexTones, you can configure which tone from generated palettes each color in the ColorScheme use. Set limits on used CAM16 chroma values for the three colors used as keys for primary, secondary and tertiary TonalPalettes.",null,null,null,null,null,null,null,null,null,null)
B.amT=new A.cI(null,null,B.aEi,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aEr=new A.u("Custom colors",null,null,null,null,null,null,null,null,null,null)
B.aG5=new A.u("With component themes enabled you can select scheme color for the tab items and indicator separately. Using TabBarStyle conveniently syncs the TabBar to active AppBar or surface theme, but this offers more options if that is needed. These settings override used TabBarStyle, set them back to default to use TabBarStyle again.",null,null,null,null,null,null,null,null,null,null)
B.amU=new A.cI(null,B.aEr,B.aG5,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aDp=new A.u("In Material Design 3, seed generated light and dark mode ColorSchemes use same key colors to generate six tonal palettes. Both light and dark theme ColorScheme colors are picked from these palettes, but using different tones. To ensure light and dark themes use identical tonal palettes, FlexColorScheme automatically only uses the light mode colors from built-in schemes to seed ColorSchemes. When using custom colors, you can decide if you do so or not.",null,null,null,null,null,null,null,null,null,null)
B.amV=new A.cI(null,null,B.aDp,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
