B.aCI=new A.u("Custom color",null,null,null,null,null,null,null,null,null,null)
B.aCX=new A.u("With component themes enabled you can select scheme color for the themed AppBar background color. Using AppBarStyle is convenient and does not require activating FlexColorScheme component themes, but this offers more choices. Selecting a color to override used AppBarStyle, set it back to default to use AppBarStyle again.",null,null,null,null,null,null,null,null,null,null)
B.amY=new A.cI(null,B.aCI,B.aCX,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aCJ=new A.u("Input color modifiers",null,null,null,null,null,null,null,null,null,null)
B.aES=new A.u("Use input modifiers to change the effective colors that define the ColorScheme. The input color values show the color before input modifiers, surrounding color is the effective result. Seeded ColorSchemes also modify input colors, above you can see how.",null,null,null,null,null,null,null,null,null,null)
B.amZ=new A.cI(null,B.aCJ,B.aES,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
